    "The influence of selenium on incubation patterns and nesting success of waterbirds
    at Ouray National Wildlife Refuge, Utah",nt"tracking_summary": {ntt"total":
    4,ntt"recent": 1nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2016-07-27T22:42:24.494226",nt"name": "the-influence-of-selenium-on-incubation-patterns-and-nesting-success-of-waterbirds-at-oura",nt"isopen":
    false,nt"url": null,nt"notes": "Egg temperatures and hen attentiveness
    were studied from 1989-91 on nests near sites known to have high selenium concentrations
    in an effort to document causes for nesting failures. Temperature and light sensitive
    radio transmitters were used to monitor incubation patterns in American coots (Fulica
    americana), mallards (Anas platyrhynchos), gadwalls (Anas strepera), northern shovelers,
    (Anas clypeata), and redheads (Aythya americana) nests. Mean temperatures of telemetered
    eggs placed in incubated nests ranged from 32.6u00b0C to 37.8u00b0C and differed
    only slightly from results obtained in other studies. We found no nesting failures
    among nests with low levels of selenium, attentive hens, and no predation or abandonment.
    However, nesting success of attentive hens experiencing no predation but incubating
    embryos containing high levels (> 10,ug/g dry weight) of selenium was poor (29%).
    Interrelationships of selenium concentrations and incubation patterns are discussed.",nt"license_title":
